import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { fetchDogs, fetchDogsSuccess, filterDogs, sortDogs } from '../../redux/actions/index';
import SearchBar from './SearchBar';
import DogCard from './DogCard';
import Filters from './Filters';
import Pagination from './Pagination';
import "./homePage.css"

const HomePage = ({
  fetchDogs,
  searchDogs,
  filterDogs,
  sortDogs,
  dogs,
  loading,
  error,
  searchQuery,
  filters,
  sort,
  currentPage,
  totalPages,
  onPageChange,
}) => {
  useEffect(() => {
    fetchDogs();
  }, [fetchDogs]);

  const handleSearch = (query) => {
    fetchDogsSuccess(query);
  };

  const handleFilter = (filter) => {
    filterDogs(filter);
  };

  const handleSort = (sort) => {
    sortDogs(sort);
  };

  return (
    <div className="home-container">
      <SearchBar onSearch={handleSearch} searchQuery={searchQuery} />
      <div className="filter-container">
        <Filters filters={filters} onFilter={handleFilter} />
      </div>
      <div className="order-container">
        <label htmlFor="sort">Ordenar por:</label>
        <select
          id="sort"
          value={sort}
          onChange={(e) => handleSort(e.target.value)}
        >
          <option value="name_asc">Nombre (A-Z)</option>
          <option value="name_desc">Nombre (Z-A)</option>
          <option value="weight_asc">Peso (ascendente)</option>
          <option value="weight_desc">Peso (descendente)</option>
        </select>
      </div>
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>{error}</p>
      ) : (
        <>
          <div className="dogs-container">
            {dogs.map((dog) => (
              <DogCard key={dog.id} dog={dog} />
            ))}
          </div>
          <Pagination
            currentPage={currentPage}
            totalPages={totalPages}
            onPageChange={onPageChange}
          />
        </>
      )}
    </div>
  );
};

const mapStateToProps = (state) => ({
  dogs: state.dogs.dogs,
  loading: state.dogs.loading,
  error: state.dogs.error,
  searchQuery: state.dogs.searchQuery,
  filters: state.dogs.filters,
  sort: state.dogs.sort,
  currentPage: state.dogs.currentPage,
  totalPages: state.dogs.totalPages,
});

const mapDispatchToProps = (dispatch) =>
  bindActionCreators(
    {
      fetchDogs,
      fetchDogsSuccess,
      filterDogs,
      sortDogs,
    },
    dispatch
  );

export default connect(mapStateToProps, mapDispatchToProps)(HomePage);
